import React from 'react';

const Favorites = ({ favorites, onRemoveFavorite }) => {
  return (
    <div>
      <h2>Favori Filmler</h2>
      {favorites.map((movie) => (
        <div key={movie.imdbID}>
          <h3>{movie.Title}</h3>
          <button onClick={() => onRemoveFavorite(movie)}>Çıkar</button>
        </div>
      ))}
    </div>
  );
};

export default Favorites;
